import React, { Children } from 'react';
import styled from 'styled-components';

const WebBar = styled.div`
    width: 1728px;
    height: 73px;
    flex-shrink: 0;

    border: 1px solid #C8C8C8;
    background: #E7F8FF;
`;

const Bar = ({Children}) => {
    return <WebBar>{Children}</WebBar>;
}

export default Bar;
